import React, { PureComponent } from 'react';
import { AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, Legend } from 'recharts';

const data = [
  {
    name: 'Page A',
    uv: 4000,
    pv: 2400,
    amt: 2400,
  },
  {
    name: 'Page B',
    uv: 3000,
    pv: 1398,
    amt: 2210,
  },
  {
    name: 'Page C',
    uv: 2000,
    pv: 9800,
    amt: 2290,
  },
  {
    name: 'Page D',
    uv: 2780,
    pv: 3908,
    amt: 2000,
  },
  {
    name: 'Page E',
    uv: 1890,
    pv: 4800,
    amt: 2181,
  },
  {
    name: 'Page F',
    uv: 2390,
    pv: 3800,
    amt: 2500,
  },
  {
    name: 'Page G',
    uv: 3490,
    pv: 4300,
    amt: 2100,
  },
];

export default class NumOfOrders extends PureComponent {
  static demoUrl = 'https://codesandbox.io/s/stacked-area-chart-ix341';

  render() {
    return (
        <ResponsiveContainer width={1000} height="90%">

<AreaChart width={1000} height={250} data={data}
  margin={{ top: 10, right: 30, left: -10, bottom: 0 }}>
<Legend align="right" verticalAlign="top" height={30}/>
  <defs>
    <linearGradient id="colorUv" x1="0" y1="0" x2="0" y2="1">
      <stop offset="5%" stopColor="#558EFA" stopOpacity={0.8}/>
      <stop offset="95%" stopColor="#558EFA" stopOpacity={0}/>
    </linearGradient>
    <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
      <stop offset="5%" stopColor="#FFAA004D" stopOpacity={0.8}/>
      <stop offset="95%" stopColor="#FFAA000D" stopOpacity={0}/>
    </linearGradient>
    <linearGradient id="colorAmt" x1="0" y1="0" x2="0" y2="1">
      <stop offset="5%" stopColor="#26A17B" stopOpacity={0.8}/>
      <stop offset="95%" stopColor="#FFFFFF" stopOpacity={0}/>
    </linearGradient>
  </defs>
  <XAxis dataKey="name" />
  <YAxis />
  <CartesianGrid strokeDasharray="2 2" vertical={false} horizontal={true}/>
  <Tooltip />
  <Area type="monotone" dataKey="uv" stroke="#558EFA" fillOpacity={1} fill="url(#colorUv)" />
  <Area type="monotone" dataKey="pv" stroke="#FFAA004D" fillOpacity={1} fill="url(#colorPv)" />
  <Area type="monotone" dataKey="amt" stroke="#26A17B" fillOpacity={1} fill="url(#colorAmt)" />
</AreaChart>
</ResponsiveContainer>
    );
  }
}
